import React, {useState, ChangeEvent} from "react";
import "./signIn.css"
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.css';
import { Navigate, useNavigate } from 'react-router-dom';


function SignIn() {
  const navigate = useNavigate();

  const [userName, setUserName] = useState("");
  const [password, setPassword] = useState("");

  const handleSignUpClick = () => {
    navigate("/Sign_up"); // Navigate to the sign-up page
  };

  const handleUserNameChange = async (e: ChangeEvent<HTMLInputElement>) => {
    const newUserName = e.target.value;
    setUserName(newUserName);
    console.log(newUserName);
  };

  const handlePasswordChange = (e: ChangeEvent<HTMLInputElement>) => {
    const newPassword = e.target.value;
    setPassword(newPassword);
    console.log(newPassword);
  };

  return (
    <div className="sign_in_container">
      <div className="sign_in_input">
        <h1>Sign in</h1>
        <div className="mb-3 sign_in_input">
          <label htmlFor="inputUsername" className="form-label">User Name</label>
          <input type="text" className="form-control" id="inputUsername" name="username" value={userName} onChange={handleUserNameChange} />
        </div>
        <div className="mb-3 sign_in_input">
          <label htmlFor="inputPassword" className="form-label">Password</label>
          <input type="password" className="form-control" id="inputPassword" name="password" value={password} onChange={handlePasswordChange} />
        </div>
      </div>

      <div className="sign_in_button_container">
        <button className="btn btn-primary sign_in_button" value="log">Log In</button>
        <button className="btn btn-primary sign_in_button" value="register" onClick={handleSignUpClick}>Sign Up</button>
      </div>
    </div>
  );
}

export default SignIn;
